import React, { useRef } from "react";
import { useState } from "react";
import emailjs from '@emailjs/browser';
function Contact(props) {
  const border={
    border:"1px solid blue"
  };

  const form = useRef();
  const [name,setname] =useState("");
  const [email,setemail] =useState("");
  const [contact,setcontact] =useState("");
  const [textarea,settextarea] =useState("");
  const ename=(event)=>{ setname(event.target.value); }
  const eemail=(event)=>{ setemail(event.target.value); }
  const econtact=(event)=>{ setcontact(event.target.value); }
  const etextarea=(event)=>{ settextarea(event.target.value); }
    const sendEmail = (e) => {
      e.preventDefault();
      emailjs.sendForm('service_epe997h', 'template_atxwwcg', form.current, 'WvDZ4qFBR6DGGOMNt')
        .then((result) => {
            console.log(result.text);
        }, (error) => {
            console.log(error.text);
        });
        setcontact('');
        settextarea('');
        setname('');
        setemail("");
        alert("You data is submmited succesfully");

    };

  return (
    <div className="contact" id="contact">
      <h1 className="stroke-text">
        {" "}
        <i> Contact Me</i>
      </h1>
      <div className="text-center">
        <p className="text-info fs-4">what's Next ?</p>
        <h1
          className={`f-bold text-${props.mode === "light" ? "dark" : "light"}`}
        >
          Get In Touch
        </h1>
        <div>
          <p className={`text-${props.mode === "light" ? "dark" : "light"}`}>
            I am available to work on your projects and bring your ideas to
            life. I am just a click away.
          </p>
        </div>
      </div>
      <div style={{flexWrap:"wrap"}} className="main d-flex mt-5">
        <div className="form-left ">
          <div className="mt-4">
            <i className="uil bg-light  rounded-circle fs-1  uil-location-pin-alt"></i>{" "}
            <span className="text-white">
              {" "}
              <a
                className="text-decoration-none"
                href="https://www.google.com/maps/place/Aliah+University/@22.5894397,88.4845858,17z/data=!3m1!4b1!4m5!3m4!1s0x3a0275a57df0d8fb:0x3d6f3c9f28c20ab1!8m2!3d22.5894397!4d88.4867745"
                target="_blank"
                rel="noopener noreferrer"
              >
                New Town Kolkata,West Bengal 700156
              </a>{" "}
            </span>
          </div>
          <div className="mt-4">
            <i className="uil fs-1 bg-light rounded-circle uil-envelope"></i>{" "}
            <a
              target="_blank"
              rel="noreferrer"
              className="text-decoration-none "
              href="mailto:shoyebmd424@gmail.com"
            >
              shoyebmd424@gmail.com
            </a>
          </div>
          <div className="mt-4">
            <i className="uil fs-1 bg-light rounded-circle uil-phone-alt"></i>
            <a
              target="_blank"
              className="text-decoration-none"
              href="http://tel:+1-555-555-1212"
              rel="noopener noreferrer"
            >
              +91-9871904481
            </a>
          </div>
        </div>
        <form ref={form} onSubmit={sendEmail} className="col-lg-7 col-11 ms-auto">
          <div>
            <div className="mb-3 flex-1">
              <input style={border} onChange={ename}
                placeholder="Full Name"
                value={name}
                type="text"
                className=" text-info bor-radius form-control"
                id="name"
                aria-describedby="nameHelp"
              />
            </div>
            <div className="d-flex ">
              <div className="mb-3 w-50">
                <input style={border} onChange={eemail}
                  placeholder="Email"
                  value={email}
                  type="email" 
                  name="email"
                  className="  text-info  bor-radius form-control"
                  id="exampleInputEmail1"
                  aria-describedby="emailHelp"
                />
              </div>
              <div className="mb-3  ms-4 w-50">
                <input style={border} onChange={econtact}
                  placeholder="Phone Number"
                  value={contact}
                  name="contact"
                  type="number"
                  className=" text-info  bor-radius form-control"
                  id="contact"
                />
              </div>
            </div>
          </div>
          <div>
            <textarea style={border}  onChange={etextarea}
              className="w-100 p-3  text-info bor-radius"
              name="textarea"
              value={textarea}
              id="desc"
              cols="30"
              rows="8"
            ></textarea>
          </div>
          <button
            type="submit"
            className="btn mt-4 px-5 py-2 border border-info btn-outline-info"
          >
            Submit
          </button>
        </form>
      </div>
    </div>
  );
}

export default Contact;
